d be all right, and would rather like it, but he would advise Harris and me not to think of it, as he felt sure we should both be ill. Harris said that, to himself, it was always a mystery how people managed to get sick at sea - said he thought people must do it on purpose, from affectation - said he had often wished to be, but had never been able.   Then he told us anecdotes of how he had gone across the Channel when it was so rough that the passengers had to be tied into their berths, and he and the captain were the only two living souls on board who were not ill. Sometimes it was he and the second mate who were not ill; but it was generally he and one other man. If not he and another man, then it was he by himself.   It is a curious fact, but nobody ever is sea-sick - on land. At sea, you come across plenty of people very bad indeed, whole boat-loads of them; but I never met a man yet, on land, who had ever known at all what it was to be sea-sick. Where the thousands upon thousands of bad sailors that swarm in every ship hide themselves when they are on land is a mystery.   If most men were like a fellow I saw on the Yarmouth boat one day, I could account for the seeming enigma easily enough. It was just off Southend Pier, I recollect, and he was leaning out through one of the port-holes in a very dangerous position. I went up to him to try and save him.   \"Hi! come further in,\" I said, shaking him by the shoulder. \"You\'ll be overboard.\"   \"Oh my! I wish I was,\" was the only answer I could get; and there I had to leave him.   Three weeks afterwards, I met him in the coffee-room of a Bath hotel, talking about his voyages, and explaining, with enthusiasm, how he loved the sea.   \"Good sailor!\" he replied in answer to a mild young man\'s envious query; \"well, I did feel a little queer once, I confess. It was off Cape Horn. The vessel was wrecked the next morning.\"   I said:    \"Weren\'t you a little shaky by Southend Pier one day, and wanted to be thrown overboard?\"   \"Southend Pier!\" he replied, with a puzzled expression.   \"Yes; going down to Yarmouth, last Friday three weeks.\"   \"Oh, ah - yes,\" he answered, brightening up; \"I remember now. I did have a headache that afternoon. It was the pickles, you know. They were the most disgraceful pickles I ever tasted in a respectable boat. Did you have any?\"   For myself, I have discovered an excellent preventive against sea-sickness, in balancing myself. You stand in the centre of the deck, and, as the ship heaves and pitches, you move your body about, so as to keep it always straight. When the front of the ship rises, you lean forward, till the deck almost touches your nose; and when its back end gets up, you lean backwards. This is all very well for an hour or two; but you can\'t balance yourself for a week.',NULL),(1370,2,'b3ef3bc3d121547a:10f34cc:ffc219949c:-7fdc','2004-10-22 15:32:48',14415,'. But I was afraid for George. George',NULL),(1371,2,'b3ef3bc3d121547a:10f34cc:ffc219949c:-7fdb','2004-10-22 15:33:22',17313,' He said we should have fresh air, exercise and quiet; the constant change of scene would occupy our minds (including what there was of Harris\'s); and the hard work would give us a good appetite, and make us sleep well.   Harris said he didn\'t think George ought to do anything that would have a tendency to make him sleepier than he always was, as it might be dangerous.   He said he didn\'t very well understand how George was going to sleep any more than he did now, seeing that there were only twenty-four hours in each day, summer and winter alike; but thought that if he did sleep any more, he might just as well be dead, and so save his board and lodging.   Harris said, however, that the river would suit him to a \"T.\" I don\'t know what a \"T\" is (except a sixpenny one, which includes bread-and- butter and cake ad lib., and is cheap at the price, if you haven\'t had any dinner). It seems to suit everybody, however, which is greatly to its credit.     It suited me to a \"T\" too, and Harris and I both said it was a good idea of George\'s; and we said it in a tone that seemed to somehow imply that we were surprised that George should have come out so sensible.',NULL),(1372,2,'b3ef3bc3d121547a:10f34cc:ffc219949c:-7fda','2004-10-22 15:33:41',18679,'There\'s nothing for me to do. Scenery is not in my line, and I don\'t smoke. If I see a rat, you won\'t stop; and if I go to sleep, you get fooling about with the boat, and slop me overboard. If you ask me, I call the whole thing bally foolishness.\"',NULL),(1373,2,'029e4aa5294809f0:ca01f0:ffc1deb4c7:-72e0','2004-10-22 15:40:25',672,'feared',NULL),(1374,1,'029e4aa5294809f0:ca01f0:ffc1deb4c7:-72df','2004-10-22 15:40:25',665,'desired',NULL),(1375,1,'029e4aa5294809f0:ca01f0:ffc1deb4c7:-72d8','2004-10-22 15:40:33',955,' and whiskers and paw prints are everywhere!',NULL),(1376,2,'029e4aa5294809f0:ca01f0:ffc1deb4c7:-72a6','2004-10-22 15:40:44',999,'.',NULL),(1377,4,'b3ef3bc3d121547a:10f34cc:ffc219949c:-7fd0','2004-10-22 15:44:41',0,'',NULL),(1378,3,'bd418ba8ab3d0fa6:ba0fda:ffc214fa36:-7ff6','2004-10-22 15:52:41',88,'Gerta',NULL),(1379,3,'b3ef3bc3d121547a:10f34cc:ffc219949c:-7fbf','2004-10-22 16:02:10',896,'repressed the presence of the dog',NULL),(1380,3,'029e4aa5294809f0:95d502:ffc25be1cd:-7fee','2004-10-22 16:38:51',18590,'Montmorency.',NULL),(1381,3,'029e4aa5294809f0:95d502:ffc25be1cd:-7fe8','2004-10-22 16:40:58',18,'puss',NULL),(1382,3,'029e4aa5294809f0:95d502:ffc25be1cd:-7fe3','2004-10-22 16:41:38',37,'Sigmund',NULL),(1383,2,'029e4aa5294809f0:95d502:ffc25be1cd:-7fe1','2004-10-22 16:41:54',31,'Sigmund,',NULL),(1384,1,'029e4aa5294809f0:95d502:ffc25be1cd:-7fe0','2004-10-22 16:41:54',15,'Oh you dog, you,',NULL),(1385,3,'029e4aa5294809f0:95d502:ffc25be1cd:-7fe9','2004-10-22 16:40:58',321,' Dog ',NULL),(1386,3,'029e4aa5294809f0:95d502:ffc25be1cd:-7fe4','2004-10-22 16:41:38',321,' Dog ',NULL),(1387,3,'029e4aa5294809f0:95d502:ffc25be1cd:-7fd0','2004-10-22 16:42:18',321,