INSERT INTO `discussion` VALUES (1,5,'Linking weirdness','<html>\n  <head>\n\n  </head>\n  <body>\n    <p>\n      Ahh, i\'ve figured out what\'s strange.  Links and comments seem to affect \n      the previous state of the document rather than the one resulting from \n      your move, so when you follow a link that you yourself made last move, \n      you still get a review copy.\n    </p>\n  </body>\n</html>\n','2004-10-15 17:51:49',-1,1),(2,5,'discussion window icons','<html>\n  <head>\n\n  </head>\n  <body>\n    <p>\n      I just noticed that the icons on the discussion window frame are broken. \n       I\'m not sure why, but it should be an easy fix.\n    </p>\n  </body>\n</html>\n','2004-10-15 17:52:47',-1,1),(3,5,'Time sliding and document versions','<html>\n  <head>\n\n  </head>\n  <body>\n    <p>\n      Simply put, i\'m not sure exactly why, but when i pull the slider all the \n      way left and then open a document, it gives me the version of that \n      document after my first move.  More investigation is needed.\n    </p>\n  </body>\n</html>\n','2004-10-15 17:54:25',-1,1),(4,6,'link problem','<html>\n  <head>\n\n  </head>\n  <body>\n    <p>\n      It appears that links within the document work strangely.  I tried to \n      create a link between two passages, but when I click the link it opens \n      up the document in &quot;review mode&quot;.  I expected the cursor to jump to the \n      link location in the document.\n    </p>\n  </body>\n</html>\n','2004-10-18 13:43:29',-1,8),(5,6,'RE: link problem','<html>\n  <head>\n\n  </head>\n  <body>\n    <p>\n      Disregard my comment.  After further reflection I realized I was editing \n      the document in a past state with the timeline.  This may cause \n      confusion for others as well.\n    </p>\n  </body>\n</html>\n','2004-10-18 13:47:18',4,8),(6,6,'RE: link problem','<html>\n  <head>\n\n  </head>\n  <body>\n    <p>\n      This is a known problem.  IVN53 in Scarab.  It happens because the link \n      is linking to the version of the document as it stood before your \n      current move, a.k.a. the previous version of the document.\n    </p>\n  </body>\n</html>\n','2004-10-18 15:48:45',4,9),(7,6,'\"Smoking Gun\" added in wrong place on DFCircle','<html>\n  <head>\n\n  </head>\n  <body>\n    <p>\n      Anyone else see &quot;Smoking Gun&quot; added between &quot;Three Men in a Boat&quot; and \n      &quot;Letter to Josef B.&quot;?  It should be next to &quot;Unpublished Diaries of SF&quot; \n      instead.\n    </p>\n  </body>\n</html>\n','2004-10-18 15:50:11',-1,9),(8,6,'Inspiration lines','<html>\n  <head>\n\n  </head>\n  <body>\n    <p>\n      Why doesn\'t an inspiration line come up when I linked into a document \n      that lacan added?\n    </p>\n  </body>\n</html>\n','2004-10-18 16:26:43',-1,12),(9,6,'problem w/ Ed.\'s move #5','<html>\n  <head>\n\n  </head>\n  <body>\n    <p>\n      about halfway through Ed\'s last move, something screws up with the \n      offsets and his adds and deletes show up bumped several characters to \n      the left of where they should be!\n    </p>\n  </body>\n</html>\n','2004-10-20 09:31:04',-1,15),(10,6,'questions and tests','<html>\n  <head>\n\n  </head>\n  <body>\n    <p>\n      I\'m just trying out features to see if I can figure out how to make them \n      work. I\'ll see where this ends up in a minute. \n    </p>\n  </body>\n</html>\n','2004-10-22 15:18:43',-1,13),(11,6,'move narrative destination?','<html>\n  <head>\n\n  </head>\n  <body>\n    <p>\n      Where does the move narrative show up? When I go into the Log and click \n      through players, then their moves, should the narrative show up in that \n      window at the bottom that corresponds to the move? \n    </p>\n  </body>\n</html>\n','2004-10-22 15:38:54',-1,13),(12,6,'RE: move narrative destination?','<html>\n  <head>\n\n  </head>\n  <body>\n    <p>\n      Yes, that\'s right -- it shows up in the log when you\'ve selected a move, \n      and also in a tool-tip/pop-up thing over the player circle when you \n      mouse over him in the discourse field.\n    </p>\n  </body>\n</html>\n','2004-10-22 15:47:38',-1,15);
