INSERT INTO `link_target` VALUES (1,1,'same problem',NULL,1,8,0,'2004-10-15 17:21:59','11d1def534ea1be0:4b29cf:ff9e84d6b2:-7ffc'),(2,4,'digital history','This is not rendering properly because the text was imported into Ivanhoe as text, not HTML, and this HTML viewer doesn\'t support the extended character set.  In HTML, this is \"&eacute;\"',0,0,0,NULL,NULL),(5,4,'a clue','Obviously not a typo.  I\'m guessing this is a mistake from an OCR scan.',0,0,0,NULL,NULL),(8,1,'same problem',NULL,1,7,0,'2004-10-15 17:18:17','11d1def534ea1be0:4b29cf:ff9e84d6b2:-7ffb'),(9,2,'an interview','http://www.murakami.ch/rd/translators/translators_an_email_roundtable_gabriel_randonhouse.html',0,0,0,NULL,NULL),(16,4,'woof','too late, you did say something about the dog',0,0,0,NULL,NULL),(17,2,'definition','http://www.cogsci.princeton.edu/cgi-bin/webwn?stage=1&word=zymosis',0,0,0,NULL,NULL),(33,1,'saying it, at last',NULL,8,9,0,'2004-10-18 12:20:35','bd418ba8ab3d0fa6:c94b8f:ffad25bdf9:-7fff'),(34,1,'saying it, at last',NULL,8,9,0,'2004-10-18 12:20:35','bd418ba8ab3d0fa6:c94b8f:ffad25bdf9:-8000'),(35,4,'rejection','On the contrary, Jerome K is quite clear about the dog.  It is plain as day that the dog is at most a reluctant companion among silly compatriots.  The dog, I suspect, would be offended to be so trivially dismissed and misunderstood.',0,0,0,NULL,NULL),(39,1,'Symbolic Meaning',NULL,10,9,0,'2004-10-18 09:01:10','b3ef3bc3d121547a:152e961:ffad3a3cf3:-7ff9'),(40,1,'Symbolic Meaning',NULL,10,16,0,'2004-10-18 13:24:09','b3ef3bc3d121547a:152e961:ffad3a3cf3:-7ffa'),(41,1,'More Symbolic Meanin',NULL,10,9,0,'2004-10-18 09:01:10','b3ef3bc3d121547a:152e961:ffad3a3cf3:-7fea'),(42,1,'More Symbolic Meanin',NULL,10,16,0,'2004-10-18 13:24:09','b3ef3bc3d121547a:152e961:ffad3a3cf3:-7feb'),(43,1,'',NULL,10,9,0,'2004-10-18 09:01:10','b3ef3bc3d121547a:152e961:ffad3a3cf3:-7fe6'),(44,1,'',NULL,10,16,0,'2004-10-18 13:24:09','b3ef3bc3d121547a:152e961:ffad3a3cf3:-7fe7'),(45,1,'',NULL,10,9,0,'2004-10-18 09: