 w/Z so as to preserve sentence structure -- but above all, hurry! -- no time to dawdle over indiv. words',0,0,0,NULL,NULL),(591,4,'ah!','was wondering what a \"Referee\" was.',0,0,0,NULL,NULL),(592,4,'that\'s funny',' ',0,0,0,NULL,NULL),(1003,4,'giddy with laughter','ROTFLMA!',0,0,0,NULL,NULL),(1004,1,'boys will be girls',NULL,13,10,0,'2004-10-18 12:12:21','029e4aa5294809f0:ca01f0:ffc1deb4c7:-7ffe'),(1009,4,'boys will be girls','lit our filter tipped cigs and stuck \'em in their enamelled holders',0,0,0,NULL,NULL),(1010,1,'boys will be girls',NULL,13,9,0,'2004-10-18 10:01:10','029e4aa5294809f0:ca01f0:ffc1deb4c7:-7ffd'),(1378,4,'unfortunate','What marvelous expertise to draw out the cat from the story, but I think the dialog of Gerta is more revealing of the non-human companion.',0,0,0,NULL,NULL),(1379,4,'L\'amour foow','I am charmed by \"foow\"\'s grotesque american transliterated representation of his essential self, \"fou\", the mad one.  Hiding himself in plain sight, in good Edgar Allen Poe fashion.  So it\'s obvious foow/fou grasps the surrealist character of all of these texts, but especially the Jerome K. dream texts.',0,0,0,NULL,NULL),(1380,4,'feline style sheets','meee-ow!',0,0,0,NULL,NULL),(1381,1,'canine to feline',NULL,10,18,0,'2004-10-18 15:00:59','029e4aa5294809f0:95d502:ffc25be1cd:-7fe9'),(1382,1,'bow-wow',NULL,10,18,0,'2004-10-18 15:00:59','029e4aa5294809f0:95d502:ffc25be1cd:-7fe4'),(1385,1,'canine to feline',NULL,13,19,0,'2004-10-22 14:43:23','029e4aa5294809f0:95d502:ffc25be1cd:-7fe8'),(1386,1,'bow-wow',NULL,13,18,0,'2004-10-22 14:38:00','029e4aa5294809f0:95d502:ffc25be1cd:-7fe3'),(1387,1,'affectionate note',NULL,13,16,0,'2004-10-22 14:34:20',NULL);
