INSERT INTO `move` VALUES (1,5,'<html>\n  <head>\n    \n  </head>\n  <body>\n    Breaking ground on this new game.\n\nAlthough with this particular example, i\'m beginning to wonder if Juxta Author \n    wouldn\'t be a better tool for comparison.\n\nWith a text like this, i do think it\'s interesting the way the digital history \n    can be traced through the glitches that speak to various errors in many \n    layers of reproduction. \n  </body>\n</html>\n','2004-10-15 17:36:06','2004-10-15 17:46:38',1,NULL,NULL),(2,6,'<html>\n  <head>\n    \n  </head>\n  <body>\n    my first annotation\n  </body>\n</html>\n','2004-10-18 10:16:47','2004-10-18 10:17:10',6,NULL,NULL),(3,6,'<html>\n  <head>\n    \n  </head>\n  <body>\n    define zymosis\n  </body>\n</html>\n','2004-10-18 10:25:33','2004-10-18 10:25:54',6,NULL,NULL),(12,6,'<html>\n  <head>\n    \n  </head>\n  <body>\n  </body>\n</html>\n','2004-10-18 14:24:09','2004-10-18 14:31:46',10,NULL,NULL),(5,6,'<html>\n  <head>\n    \n  </head>\n  <body>\n    copy editing\n  </body>\n</html>\n','2004-10-18 11:37:20','2004-10-18 11:42:47',6,NULL,NULL),(6,6,'<html>\n  <head>\n    \n  </head>\n  <body>\n    Whereupon the nature of George comes into relief.\n  </body>\n</html>\n','2004-10-18 12:13:27','2004-10-18 12:20:35',8,NULL,NULL),(8,6,'<html>\n  <head>\n    \n  </head>\n  <body>\n    This initiates the series of revelatory materials that relate to Sigmund \n    Freud\'s unrecorded case from the early 1890s.  This is his letter to his \n    friend and mentor Josef Breuer informing him of the appearance of the \n    patient he names &quot;Jerome K&quot;.\n  </body>\n</html>\n','2004-10-18 13:23:24','2004-10-18 13:27:09',10,NULL,NULL),(9,6,'<html>\n  <head>\n    \n  </head>\n  <body>\n    This second document is essential to establish the terms of the \n    interpretation of the events, including the dream events.  The document \n    also establishes an early problem regarding the question of the \n    authenticity of these materials.\n  </body>\n</html>\n','2004-10-18 13:35:08','2004-10-18 13:36:56',10,NULL,NULL),(10,6,'<html>\n  <head>\n    \n  </head>\n  <body>\n    This third document completes the series of additions that establish the \n    terms of Lacan\';s gameplay.  It is entirely possible that he is not being \n    serious.\n  </body>\n</html>\n','2004-10-18 13:43:27','2004-10-18 13:44:49',10,NULL,NULL),(11,6,'<html>\n  <head>\n    \n  </head>\n  <body>\n    Clarification about our canine companion, including revelation and a \n    rebuttal to our esteemed, yet misinformed, Dr. Freud.\n  </body>\n</html>\n','2004-10-18 13:46:28','2004-10-18 13:55:11',8,NULL,NULL),(13,6,'<html>\n  <head>\n    \n  </head>\n  <body>\n    The dream has escaped the dream world!  Is the world a dream?  Is any of \n    this true?  What are we to think of the subsequent career and work of \n    Sigmund Freud, given these revelations of his early experience with \n    pathological patients?  And why did SF never make this extraordinary \n    clinical experience a central subject of his theory and practice?\n  </body>\n</html>\n','2004-10-18 14:40:41','2004-10-18 14:43:00',10,NULL,NULL),(14,6,'<html>\n  <head>\n    \n  </head>\n  <body>\n  </body>\n</html>\n','2004-10-18 14:50:47','2004-10-18 15:00:59',10,NULL,NULL),(15,6,'<html>\n  <head>\n    \n  </head>\n  <body>\n    deep thoughts\n  </body>\n</html>\n','2004-10-18 12:12:21','2004-10-18 15:11:13',6,NULL,NULL),(16,6,'<html>\n  <head>\n\n  </head>\n  <body>\n    Further exposition on the quandry with Josef, Sigmund, and two men named \n    &quot;Jerome K.&quot;\n  </body>\n</html>\n','2004-10-18 16:17:32','2004-10-18 16:24:54',12,NULL,NULL),(17,6,'<html>\n  <head>\n    \n  </head>\n  <body>\n    A lyric for entertainment. \n  </body>\n</html>\n','2004-10-18 16:13:33','2004-10-18 16:39:24',13,NULL,NULL),(18,6,'<html>\n  <head>\n    \n  </head>\n  <body>\n    This move is made to dismiss the frivolous text masquerading as a serious \n    move by a player who shall not be namaed.\n  </body>\n</html>\n','2004-10-18 16:53:43','2004-10-18 16:57:55',10,NULL,NULL),(19,6,'','2004-10-18 16:30:38',NULL,12,NULL,NULL),(20,6,'<html>\n  <head>\n    \n  </head>\n  <body>\n    A bit more light to shed on the dog in our midst\n  </body>\n</html>\n','2004-10-18 20:41:14','2004-10-18 20:49:07',8,NULL,NULL),(21,6,'<html>\n  <head>\n    \n  </head>\n  <body>\n    holy mother of Dog, please let me think of something before middle \n    management gets wind of this\n  </body>\n</html>\n','2004-10-19 10:33:03','2004-10-19 10:35:38',15,NULL,NULL),(22,6,'<html>\n  <head>\n    \n  </head>\n  <body>\n    Ed. becomes Anon.\n  </body>\n</html>\n','2004-10-19 10:43:00','2004-10-19 11:08:16',15,NULL,NULL),(23,6,'<html>\n  <head>\n    \n  </head>\n  <body>\n    not as easy as I thought. (maybe not as funny as I thought.)  but do I \n    have any other choice?  tick tock.\n  </body>\n</html>\n','2004-10-19 14:24:51','2004-10-19 15:01:47',15,NULL,NULL),(24,6,'<html>\n  <head>\n    \n  </head>\n  <body>\n    A little encouragement from an appreciative reader.\n  </body>\n</html>\n','2004-10-19 15:27:50','2004-10-19 15:28:55',5,NULL,NULL),(25,6,'<html>\n  <head>\n    \n  </head>\n  <body>\n    cranking it out, now!  woo hoo -- screw you, Random House.  I\'ll give you \n    random.\n  </body>\n</html>\n','2004-10-19 14:24:51','2004-10-19 15:42:12',15,NULL,NULL),(26,6,'<html>\n  <head>\n    \n  </head>\n  <body>\n    more cheerleading\n  </body>\n</html>\n','2004-10-19 16:22:33','2004-10-19 16:26:59',5,NULL,NULL),(27,6,'<html>\n  <head>\n    \n  </head>\n  <body>\n    one chapter down!  i think this is going to work.  i\'ll make my deadline \n    and those morons will never catch me!\n  </body>\n</html>\n','2004-10-20 08:22:33','2004-10-20 09:18:31',15,NULL,NULL),(28,6,'<html>\n  <head>\n    \n  </head>\n  <body>\n    a letter from the Editor.\n  </body>\n</html>\n','2004-10-20 14:10:45','2004-10-20 14:12:17',15,NULL,NULL),(31,6,'<html>\n  <head>\n    \n  </head>\n  <body>\n    Trans Actions are the necessary all over corrective to this narrative, of \n    course, and the whole idea of the cat in the canoe really tips things \n    right over.\n  </body>\n</html>\n','2004-10-22 14:20:57','2004-10-22 14:24:00',13,NULL,NULL),(30,6,'<html>\n  <head>\n    \n  </head>\n  <body>\n    An irrestable urge to applaud\n  </body>\n</html>\n','2004-10-21 10:24:50','2004-10-21 10:31:51',8,NULL,NULL),(32,6,'<html>\n  <head>\n    \n  </head>\n  <body>\n    More changes of the same kind.\n  </body>\n</html>\n','2004-10-22 14:24:21','2004-10-22 14:26:18',13,NULL,NULL),(33,6,'<html>\n  <head>\n    \n  </head>\n  <body>\n    Passions will erupt and of course the little dear is such a tempting puss.\n  </body>\n</html>\n','2004-10-22 14:26:36','2004-10-22 14:31:49',13,NULL,NULL),(34,6,'<html>\n  <head>\n    \n  </head>\n  <body>\n    More on the puss, from the experts.\n  </body>\n</html>\n','2004-10-22 14:32:10','2004-10-22 14:34:20',13,NULL,NULL),(35,6,'<html>\n  <head>\n    \n  </head>\n  <body>\n    Poor creatures, how deluded they were, how delighted now!\n  </body>\n</html>\n','2004-10-22 14:34:37','2004-10-22 14:38:00',13,NULL,NULL),(36,6,'<html>\n  <head>\n    \n  </head>\n  <body>\n    A peace offering to the poor deluded Sigmund. He liked the little pussies, \n    I believe.\n  </body>\n</html>\n','2004-10-22 14:38:15','2004-10-22 14:40:22',13,NULL,NULL),(37,6,'<html>\n  <head>\n    \n  </head>\n  <body>\n    Oh yes, thorough correctives.\n  </body>\n</html>\n','2004-10-22 14:41:02','2004-10-22 14:43:23',13,NULL,NULL),(38,6,'<html>\n  <head>\n    \n  </head>\n  <body>\n    Even the official documents need to be changed.\n  </body>\n</html>\n','2004-10-22 14:43:47','2004-10-22 14:44:14',13,NULL,NULL),(39,6,'<html>\n  <head>\n    \n  </head>\n  <body>\n    Authorship attribution also shifts.\n  </body>\n</html>\n','2004-10-22 14:44:27','2004-10-22 14:45:04',13,NULL,NULL),(40,6,'<html>\n  <head>\n    \n  </head>\n  <body>\n    Feline style sheets should be used throughout. \n  </body>\n</html>\n','2004-10-22 14:45:31','2004-10-22 14:47:14',13,NULL,NULL),(41,6,'<html>\n  <head>\n    \n  </head>\n  <body>\n    Just the start of the mega-transformation.\n  </body>\n</html>\n','2004-10-22 14:47:29','2004-10-22 14:58:39',13,NULL,NULL),(42,6,'<html>\n  <head>\n    \n  </head>\n  <body>\n    Short cuts to happy endings.\n  </body>\n</html>\n','2004-10-22 15:13:32','2004-10-22 15:31:18',13,NULL,NULL),(43,6,'<html>\n  <head>\n    \n  </head>\n  <body>\n  </body>\n</html>\n','2004-10-22 15:29:40','2004-10-22 15:39:10',10,NULL,NULL),(44,6,'<html>\n  <head>\n    \n  </head>\n  <body>\n    Just the final gesture.\n  </body>\n</html>\n','2004-10-22 15:40:25','2004-10-22 15:40:54',13,NULL,NULL),(45,6,'<html>\n  <head>\n    \n  </head>\n  <body>\n    Breton\'s letter, while undated, must surely come after the writing of \n    L\'amour fou, not before.  Why else would he be so thrilled about &quot;proving&quot; \n    the truth of his mad belief that dreams are forecasts?\n  </body>\n</html>\n','2004-10-22 15:44:41','2004-10-22 15:46:22',10,NULL,NULL),(46,6,'<html>\n  <head>\n    \n  </head>\n  <body>\n    A small rebuff about animals and humans, carrying on with my effort to say \n    something about the dog.\n  </body>\n</html>\n','2004-10-22 15:52:41','2004-10-22 15:53:24',8,NULL,NULL),(47,6,'<html>\n  <head>\n    \n  </head>\n  <body>\n    An explication of Foow as Fou\n  </body>\n</html>\n','2004-10-22 16:02:10','2004-10-22 16:02:47',10,NULL,NULL),(48,6,'<html>\n  <head>\n    \n  </head>\n  <body>\n    oh the changes!\n  </body>\n</html>\n','2004-10-22 16:38:51','2004-10-22 16:39:50',13,NULL,NULL),(49,6,'<html>\n  <head>\n    \n  </head>\n  <body>\n  </body>\n</html>\n','2004-10-22 16:40:58','2004-10-22 16:42:47',13,NULL,NULL);
